import {BrowserRouter as Router, Route} from 'react-router-dom'

import Footer from './components/Footer'
import Home from './components/Home'

class App extends Component {

  render() {
    return (
      <div className="App">
        <Router>

        </Router>
        <Home />
        <Footer/>
      </div>
    );
  }
}

export default App;
